CREATE TABLE `usuario` (
  `US_ID` int(11) NOT NULL AUTO_INCREMENT,
  `US_CEDULA` varchar(10) NOT NULL,
  `US_APELLIDO` varchar(50) NOT NULL,
  `US_NOMBRE` varchar(50) NOT NULL,
