  `US_FECHA_NACIMIENTO` date NOT NULL,
  `US_GENERO` char(20) DEFAULT NULL,
  `US_TIPO_SANGRE` varchar(10) DEFAULT NULL,
  `US_ETNIA` varchar(20) DEFAULT NULL,
  `US_ESTADO` char(1) NOT NULL,
  `INF_ID` int(11) NOT NULL,
  `PRR_ID` int(11) NOT NULL,
  `TUS_ID` int(11) NOT NULL,
  PRIMARY KEY (`US_ID`),
  UNIQUE KEY `US_CEDULA` (`US_CEDULA`),
  KEY `INF_ID` (`INF_ID`),
  KEY `PRR_ID` (`PRR_ID`),
  KEY `TUS_ID` (`TUS_ID`),
  CONSTRAINT `usuario_ibfk_1` FOREIGN KEY (`INF_ID`) REFERENCES `instruccion_formal` (`INF_ID`),
  CONSTRAINT `usuario_ibfk_2` FOREIGN KEY (`PRR_ID`) REFERENCES `parroquia` (`PRR_ID`),
  CONSTRAINT `usuario_ibfk_3` FOREIGN KEY (`TUS_ID`) REFERENCES `tipo_de_usuario` (`TUS_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=2538 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
